package btree

import (
	"log"
	"testing"
)

func TestBtreeOrder5(t *testing.T) {

	data := insertData()
	B := New(5)

	check := []keyStruct{}
	var treeArray []keyStruct

	for _, item := range data {
		B.Insert(item, 0)
		j := 0
		for j < len(check) && item > check[j].key {
			j++
		}
		check = insertIntoSlice(check, j, keyStruct{key: item, rowPtr: 0})
		treeArray = B.ToArray()

		for i, thing := range check {
			if thing != treeArray[i] {
				log.Fatalf("Failed at iteration: %d when inserting %s", i, item)
			}
		}
	}

	data = deleteData()

	for _, item := range data {
		B.Delete(item)
		j := 0
		for j < len(check) && item > check[j].key {
			j++
		}
		check = append(check[:j], check[j+1:]...)
		treeArray = B.ToArray()
		for j, thing := range check {
			if thing != treeArray[j] {
				log.Fatalf("Failed at iteration: %d when deleting %s", j, item)
			}
		}
	}
}

